INSERT INTO `skilltemplate` VALUES (0,'Song Thăng Long','',10,2,20,0,336),(1,'Tâm chuyển thân thuật','Tăng thêm hiệu quả cho chiêu Ân chú chi thuật',57,2,12,5,627),(2,'Ảnh phong xa','',40,2,20,0,339),(3,'Tiêu thuật tâm pháp','',20,2,10,5,337),(4,'Ấn chú chi thuật','Dùng bùa ấn chú làm giảm phòng thủ của đối phương',30,2,10,0,338),(5,'Triệu hồi dơi chi thuật','Triệu hồi dơi hút máu hỗ trợ tấn công chí mạng đồng thời hút sinh lực của đối phương chuyển sang cho chủ nhân',50,2,10,1,340),(6,'Tâm trung đoạn thủ thuật','',10,1,20,0,330),(7,'Susanoo','Dùng Susanoo tạo ra lớp tường bảo vệ cản phá sự tấn công của đối phương',57,1,12,1,620),(8,'Lôi kiếm','',40,1,20,0,333),(9,'Kiếm thuật tâm pháp','',20,1,10,5,331),(10,'Triệu hồi chim chi thuật','Triệu hồi ra chim không lồ hỗ trợ tăng cường Hp cho chủ nhân',50,1,10,1,334),(11,'Dịch chuyển chi thuật','Áp sát nhanh đến mục tiêu và giáng 1 đòn thật mạnh vào đối phương',30,1,10,0,332),(12,'Thủy long đàn thuật','',10,3,20,0,342),(13,'Byakugan','Tuyệt chiêu của gia tộc Hyuga',57,3,12,1,621),(14,'Đại bộc bố thuật','',40,3,20,0,345),(15,'Gậy thuật tâm pháp','',20,3,10,5,343),(16,'Tăng sinh chi thuật','Tăng khả năng trị lành vết thương cho mình và đồng đội',30,3,10,1,344),(17,'Thủy lao thuật','Khi Hp giảm dưới 20% chiêu sẽ được tự động sử dụng với điệu kiện có đủ Mp, tăng cường phục hồi Hp đồng thời tăng thêm sức tấn công cho bản thân',50,3,10,6,346),(18,'Ám sát thuật','',10,4,20,0,348),(19,'Byakugan','Tuyệt chiêu của gia tộc Hyuga',57,4,12,1,622),(20,'Hào hỏa cầu thuật','',40,4,20,0,351),(21,'Đao thuật tâm pháp','',20,4,10,5,349),(22,'Ẩn thân chi thuật','Che khuất tầm nhìn của đối phương, dễ dàng gây bỏng lên đối phương với nhát đánh đầu tiên sau khi hiện thân',30,4,10,1,350),(23,'Triệu hồi chim yêu chi thuật','Triệu hồi chim yêu quái có khả năng tự tấn công vào đối phương',50,4,10,1,352),(24,'Thiên sát thủy phi','',10,5,20,0,354),(25,'Charkra cửu vĩ hình','Mượn Chakra của cửu vĩ để tăng thêm Chakra cho bản thân',57,5,12,1,623),(26,'Phi Lôi Thần Thuật','',40,5,20,0,357),(27,'Dao thuật tâm pháp','',20,5,10,5,355),(28,'Ảnh phân thân chi thuật','Tách ra nhiều ảo ảnh dễ dàng né tránh sự tấn công của đối phương',30,5,10,1,356),(29,'Hiền nhân thuật','Một thuật bí truyền, chỉ những người có duyên mới được học',50,5,10,1,358),(30,'Kiếm thuật cơ bản','Kiếm thuật giết gà, chặt củi, gây sát thương nhẹ lên quái',1,0,1,0,329),(31,'Bạch Hào Chi Thuật','Thuật tự chữa lành vết thương trong thời gian ngắn',57,1,12,1,628),(32,'Ảnh thủ phược chi thuật','Dùng bóng để giữ chặt không cho đối phương di chuyển',57,2,12,0,626),(33,'Thao cụ - Thiên tỏa','Triệu hồi ra các loại binh khí khóa chặt tay chân không cho đối phương sử dụng nhẫn thuật',57,4,12,0,624),(34,'Nha thông Nha','Dùng 1 lực thật mạnh tạo thành lốc xoáy tấn công vô đối phương',57,3,12,0,625),(35,'Susano Itachi','',11,0,1,1,1141),(36,'Loa Toàn Liên Thủ Lí Kiếm','Dùng chakra để tạo ra một quả cầu gây sát thương lớn, không có tác dụng với quái',60,5,8,0,982),(37,'Thanh sắt chakra','Khóa chặt huyết mạnh chakra của đối phương, không có tác dụng với quái',60,3,8,0,984),(38,'Thiên Chiếu','Ngọn lửa đen hủy diệt, không có tác dụng với quái',60,1,8,0,983),(39,'Biệt thiên thần','Ảo thuật làm đối phương không thể thi triển nhẫn thuật, không có tác dụng với quái',60,2,8,0,980),(40,'Không thời gian thuật','Nhẫn thuật đặc biệt được thi triển bởi đôi mắt Mangekyou Sharingan, không có tác dụng với quái',60,4,8,0,981);
